import React from 'react';
import Todo from './todo';
const todolist = ({ Submitdata }) => {
	console.log(Submitdata);
	return (
		<>
			<div className="todo_list">
				{Submitdata.map(e => (
					<Todo />
				))}

				{/* <Todo />
				<Todo />
				<Todo /> */}
			</div>
		</>
	);
};

export default todolist;
